Kaartgegevens laden mislukt, gebruik lokale cachegegevens, maar geen geldige kaart gevonden. Controleer het volgende:
1. Of de netwerkverbinding correct is;
2. Of de kaartalias correct is ingesteld;
3. Of er locaties zijn gekalibreerd voor het gebruik van de lift;
4. Of er geldige puntlocaties en routes op de kaart aanwezig zijn;

Kaartgegevens succesvol geladen, maar geen geldige kaart gevonden. Controleer het volgende:
1. Of de kaartalias correct is ingesteld;
2. Of er locaties zijn gekalibreerd voor het gebruik van de lift;
3. Of er geldige puntlocaties en routes op de kaart aanwezig zijn;
